// App.js or App.tsx
import React from 'react';
import { Switch, Route } from 'react-router-dom'; // Import Switch and Route
import LandingPage from './LandingPage';
import FlightDetails from './FlightDetails';

function App() {
    return (
        <div>
            <Switch>
                <Route exact path="/" component={LandingPage} /> {/* LandingPage for the root path */}
                <Route path="/flight-details" component={FlightDetails} /> {/* FlightDetails page */}
            </Switch>
        </div>
    );
}

export default App;
